import React from "react";
import "./App.css";
import { Root } from "./components";
import store from "./store";
import { Provider } from "react-redux";

function App() {
  console.log("From app", this.props);
  return (
    <Provider store={store}>
      <Root />
    </Provider>
  );
}

export default App;
